INSERT INTO `batteries` VALUES (1,1,'Commercial','active','14','2016-01-10','2016-01-10','https://www.youtube.com/watch?v=dQw4w9WgXcQ','There is no need to try catching Chuck Norris\' exceptions for recovery; every single throw he does is fatal.','I hope to see Ruby help every programmer in the world to be productive, and to enjoy programming, and to be happy. That is the primary purpose of Ruby language.','2016-01-10 00:00:00.000000','2016-01-10 00:00:00.000000'),(2,2,'Corporate','intervention','3','2014-02-26','2014-02-26','https://www.youtube.com/watch?v=dQw4w9WgXcQ','You don\'t disable the Chuck Norris plug-in, it disables you.','From the viewpoint of what you can do, therefore, languages do differ - but the differences are limited. For example, Python and Ruby provide almost the same power to the programmer.','2014-02-26 00:00:00.000000','2014-02-26 00:00:00.000000'),(3,3,'Residential','intervention','4','2015-11-10','2015-11-10','https://www.youtube.com/watch?v=dQw4w9WgXcQ','Chuck Norris doesn\'t need a debugger, he just stares down the bug until the code confesses.','I believe that the purpose of life is, at least in part, to be happy. Based on this belief, Ruby is designed to make programming not only easy but also fun. It allows you to concentrate on the creative side of programming, with less stress.','2015-11-10 00:00:00.000000','2015-11-10 00:00:00.000000'),(4,4,'Corporate','intervention','2','2016-02-28','2016-02-28','https://www.youtube.com/watch?v=dQw4w9WgXcQ','Chuck Norris\' keyboard doesn\'t have a F1 key, the computer asks him for help.','Sometimes people jot down pseudo-code on paper. If that pseudo-code runs directly on their computers, its best, isn\'t it? Ruby tries to be like that, like pseudo-code that runs. Python people say that too.','2016-02-28 00:00:00.000000','2016-02-28 00:00:00.000000'),(5,5,'Corporate','inactive','13','2014-03-18','2014-03-18','https://www.youtube.com/watch?v=dQw4w9WgXcQ','Chuck Norris writes code that optimizes itself.','Man is driven to create; I know I really love to create things. And while I\'m not good at painting, drawing, or music, I can write software.','2014-03-18 00:00:00.000000','2014-03-18 00:00:00.000000'),(6,6,'Corporate','active','1','2017-01-02','2017-01-02','https://www.youtube.com/watch?v=dQw4w9WgXcQ','Chuck Norris\'s first program was kill -9.','From the viewpoint of what you can do, therefore, languages do differ - but the differences are limited. For example, Python and Ruby provide almost the same power to the programmer.','2017-01-02 00:00:00.000000','2017-01-02 00:00:00.000000'),(7,7,'Corporate','active','4','2021-03-18','2021-03-18','https://www.youtube.com/watch?v=dQw4w9WgXcQ','Chuck Norris does not use revision control software. None of his code has ever needed revision.','The orthogonal features, when combined, can explode into complexity.','2021-03-18 00:00:00.000000','2021-03-18 00:00:00.000000'),(8,8,'Commercial','active','6','2015-01-28','2015-01-28','https://www.youtube.com/watch?v=dQw4w9WgXcQ','Project managers never ask Chuck Norris for estimations... ever.','It is not the responsibility of the language to force good looking code, but the language should make good looking code possible.','2015-01-28 00:00:00.000000','2015-01-28 00:00:00.000000'),(9,9,'Hybrid','active','8','2014-07-28','2014-07-28','https://www.youtube.com/watch?v=dQw4w9WgXcQ','Chuck Norris doesn\'t use web standards as the web will conform to him.','Everyone has an individual background. Someone may come from Python, someone else may come from Perl, and they may be surprised by different aspects of the language. Then they come up to me and say, \'I was surprised by this feature of the language, so therefore Ruby violates the principle of least surprise.\' Wait. Wait. The principle of least surprise is not for you only.','2014-07-28 00:00:00.000000','2014-07-28 00:00:00.000000'),(10,10,'Commercial','active','4','2013-06-06','2013-06-06','https://www.youtube.com/watch?v=dQw4w9WgXcQ','The programs that Chuck Norris writes don\'t have version numbers because he only writes them once. If a user reports a bug or has a feature request they don\'t live to see the sun set.','Imagine you are writing an email. You are in front of the computer. You are operating the computer, clicking a mouse and typing on a keyboard, but the message will be sent to a human over the internet. So you are working before the computer, but with a human behind the computer.','2013-06-06 00:00:00.000000','2013-06-06 00:00:00.000000'),(11,11,'Residential','active','7','2015-11-24','2015-11-24','https://www.youtube.com/watch?v=dQw4w9WgXcQ','No statement can catch the ChuckNorrisException.','In our daily lives as programmers, we process text strings a lot. So I tried to work hard on text processing, namely the string class and regular expressions. Regular expressions are built into the language and are very tuned up for use.','2015-11-24 00:00:00.000000','2015-11-24 00:00:00.000000'),(12,12,'Corporate','active','2','2021-11-19','2021-11-19','https://www.youtube.com/watch?v=dQw4w9WgXcQ','The class object inherits from Chuck Norris.','I hope to see Ruby help every programmer in the world to be productive, and to enjoy programming, and to be happy. That is the primary purpose of Ruby language.','2021-11-19 00:00:00.000000','2021-11-19 00:00:00.000000'),(13,13,'Commercial','active','2','2020-09-30','2020-09-30','https://www.youtube.com/watch?v=dQw4w9WgXcQ','The only pattern Chuck Norris knows is God Object.','Everyone has an individual background. Someone may come from Python, someone else may come from Perl, and they may be surprised by different aspects of the language. Then they come up to me and say, \'I was surprised by this feature of the language, so therefore Ruby violates the principle of least surprise.\' Wait. Wait. The principle of least surprise is not for you only.','2020-09-30 00:00:00.000000','2020-09-30 00:00:00.000000'),(14,14,'Commercial','active','4','2013-0